          <img src='' alt="" className="transform scale-60 mb-[-2rem]" />
          <span className="text-xl">this is </span>
          <span className="text-gray-500 text-base">how is this</span>
          <button className="c-button mt-4 bg-white shadow-md rounded-md border border-gray-200 px-4 py-2 text-blue-500 hover:scale-110 transition-transform">Learn more</button>
        </div>
      )
}

export default Home;
